import React, { useState } from "react";
import "./App.css";

function App() {
  const [systemStatus, setSystemStatus] = useState("Stopped");
  const [wateringSchedule, setWateringSchedule] = useState({
    startTime: "",
    duration: "",
    endTime: "",
  });

  // Simulated sensor data for Widget 3
  const [sensorData, setSensorData] = useState({
    waterLevel: "50%", // Simulated water level
    pipeStatus: "Filled", // Simulated pipe status (Filled/Empty)
  });

  const handleStart = () => {
    setSystemStatus("Running");
  };

  const handleStop = () => {
    setSystemStatus("Stopped");
  };

  const handleScheduleChange = (e) => {
    const { name, value } = e.target;
    setWateringSchedule((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  return (
    <div className="container">
      <header className="header">
        <h1>Dashboard - Josh's Hydroponic System</h1>
      </header>
      <aside className="sidebar">
        <h2>Sidebar</h2>
        <p>Links and content go here.</p>
      </aside>
      <main className="main">
        {/* Widget 1: System Control Panel */}
        <div className="card">
          <h3>System Control Panel</h3>
          <button onClick={handleStart}>Start System</button>
          <button onClick={handleStop}>Stop System</button>
          <div className="status-indicator">
            <p>System Status: {systemStatus}</p>
            <div
              className={`status-circle ${systemStatus === "Running" ? "green" : "red"}`}
            ></div>
          </div>
        </div>

        {/* Widget 2: Watering Schedule Manager */}
        <div className="card">
          <h3>Watering Schedule Manager</h3>
          <form>
            <label>
              Start Time:
              <input
                type="time"
                name="startTime"
                value={wateringSchedule.startTime}
                onChange={handleScheduleChange}
              />
            </label>
            <br />
            <label>
              Duration (minutes):
              <input
                type="number"
                name="duration"
                value={wateringSchedule.duration}
                onChange={handleScheduleChange}
              />
            </label>
            <br />
            <label>
              End Time:
              <input
                type="time"
                name="endTime"
                value={wateringSchedule.endTime}
                onChange={handleScheduleChange}
              />
            </label>
          </form>
        </div>

        {/* Widget 3: Sensor Data */}
        <div className="card">
          <h3>Sensor Data</h3>
          <p>Water Level: {sensorData.waterLevel}</p>
          <p>Pipe Status: {sensorData.pipeStatus}</p>
        </div>

        {/* Placeholder for Widget 4 */}
        <div className="card">
          <h3>Widget 4 Placeholder</h3>
          <p>Node Diagram Coming Soon</p>
        </div>

        {/* Placeholder for Widget 5 */}
        <div className="card">
          <h3>Widget 5 Placeholder</h3>
          <p>Additional Feature Coming Soon</p>
        </div>

        {/* Placeholder for Widget 6 */}
        <div className="card">
          <h3>Widget 6 Placeholder</h3>
          <p>Additional Feature Coming Soon</p>
        </div>
      </main>
    </div>
  );
}

export default App;
